import React from 'react';

import Links from '../../Header/Links/Links';

import './Dropdown.css';

const Dropdown = (props) => {
    return (
        <div className="Dropdown">
            {props.show === "links" ?
                <>
                <Links forPhone={true}/>
                <p>Terms&nbsp;&&nbsp;Services</p>
                </> :
            null}
        </div>
    );
}

export default Dropdown;
